// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import {ModuleVersion} from "../../modules/IModule.sol";
import {IModuleRegistry, ModuleReference} from "../../core/IModuleRegistry.sol";
import {LibAccess} from '../../libraries/LibAccess.sol';
import {LibVersion} from '../../libraries/LibVersion.sol';
import {LibModule, CachedModule} from '../LibModule.sol';
import {LibEntityFactory} from '../../libraries/LibEntityFactory.sol';
import {ICoreApp} from '../../core/ICoreApp.sol';
import {LibRoles} from '../../libraries/LibRoles.sol';
import {ICoreProxy} from './ICoreProxy.sol';

struct BaseProxyContstructorArgs {
    IModuleRegistry moduleRegistry;
    address owner;
    address[] admins;
}

struct ProxyStorage {
    address implementation;
    ModuleVersion version;
}

abstract contract BaseCoreProxy is ICoreProxy {
    using LibAccess for IModuleRegistry;
    using LibAccess for CachedModule;
    using LibVersion for ModuleVersion;

    bytes32 constant STORAGE_SLOT = keccak256(abi.encode(uint256(keccak256(bytes('xr.core.proxy.storage.v1'))) - 1)) & bytes32(uint256(0xff));

    IModuleRegistry public immutable moduleRegistry;

    modifier onlyAdmin {
        require(moduleRegistry.getAccessControl().hasRole(LibRoles.ROLE_ADMIN, msg.sender), "EntityProxy: only admin allowed");
        _;
    }

    constructor(BaseProxyContstructorArgs memory args) {
        require(address(args.moduleRegistry) != address(0), "CoreProxy: module registry cannot be zero address");
        require(args.owner != address(0), "CoreProxy: owner cannot be zero address");
        moduleRegistry = args.moduleRegistry;
        CachedModule storage ac = moduleRegistry.getAccessControl();
        ac.grantRole(LibRoles.ROLE_ADMIN, args.owner);
        for (uint256 i = 0; i < args.admins.length; i++) {
            require(args.admins[i] != address(0), "CoreProxy: admin cannot be zero address");   
            ac.grantRole(LibRoles.ROLE_ADMIN, args.admins[i]);
        }
    }

    receive() external payable {}

    function load() internal pure returns (ProxyStorage storage ps) {
        bytes32 slot = STORAGE_SLOT;
        assembly {
            ps.slot := slot
        }
    }

    function setImplementation(address _newImplementation) external onlyAdmin {
        require(_newImplementation != address(0), "EntityProxy: implementation is the zero address");
        ProxyStorage storage ps = load();
        ps.implementation = _newImplementation;
        ModuleVersion memory v = ICoreApp(_newImplementation).version();
        ps.version = v;
        emit ProxyImplementationChanged(_newImplementation, v);
    }

    function implementationVersion() external view returns (ModuleVersion memory) {
        return load().version;
    }

    fallback() external {
        address _impl = load().implementation;
        assembly {
            let ptr := mload(0x40)
            calldatacopy(ptr, 0, calldatasize())
            let result := delegatecall(gas(), _impl, ptr, calldatasize(), 0, 0)
            let size := returndatasize()
            returndatacopy(ptr, 0, size)
            switch result
            case 0 { revert(ptr, size) }
            default { return(ptr, size) }
        }
    }
}

