// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import {IAccessControl} from '../modules/access/IAccessControl.sol';
import {CachedModule, LibModule} from '../core/LibModule.sol';
import {IModuleRegistry} from '../core/IModuleRegistry.sol';


library LibAccess {
    using LibModule for IModuleRegistry;
    using LibModule for CachedModule;

    function getAccessControl(IModuleRegistry registry) external returns (CachedModule storage) {
        return registry.find("IAccessControl");
    }

    function owner(CachedModule storage entry) external view returns (address) {
        bytes memory data = abi.encodeWithSelector(IAccessControl.owner.selector);
        bytes memory returnData = entry.sCall(data);
        return abi.decode(returnData, (address));
    }

    function hasRole(CachedModule storage entry, bytes32 role, address account) external view returns (bool) {
        bytes memory data = abi.encodeWithSelector(IAccessControl.hasRole.selector, role, account);
        bytes memory returnData = entry.sCall(data);
        return abi.decode(returnData, (bool));
    }

    function grantRole(CachedModule storage entry, bytes32 role, address account) external {
        bytes memory data = abi.encodeWithSelector(IAccessControl.grantRole.selector, role, account);
        entry.dCall(data);
    }

    function revokeRole(CachedModule storage entry, bytes32 role, address account) external {
        bytes memory data = abi.encodeWithSelector(IAccessControl.revokeRole.selector, role, account);
        entry.dCall(data);
    }

    function initAccess(CachedModule storage entry, address _owner, address[] memory admins) external {
        bytes memory data = abi.encodeWithSelector(IAccessControl.init.selector, _owner, admins);
        entry.dCall(data);
    }

}

