// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import {IModuleRegistry, ModuleReference} from "../core/IModuleRegistry.sol";
import {IEntityFactory} from "../modules/entity/IEntityFactory.sol";
import {ModuleVersion} from "../modules/IModule.sol";
import {LibModule, CachedModule} from "../core/LibModule.sol";

library LibEntityFactory {

    using LibModule for CachedModule;
    using LibModule for IModuleRegistry;

    function createEntity(CachedModule storage entry, address owner, string calldata name, bytes calldata initData) external returns (address) {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.createEntity.selector, owner, name, initData);
        bytes memory r = entry.dCall(data);
        return abi.decode(r, (address));
    }

    function upgradeEntity(CachedModule storage entry, bytes calldata data) external {
        bytes memory cd = abi.encodeWithSelector(IEntityFactory.upgradeEntity.selector, data);
        entry.dCall(cd);
    }

    function setImplementation(CachedModule storage entry, address newImplementation) external {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.setImplementation.selector, newImplementation);
        entry.dCall(data);
    }

    function getImplementation(CachedModule storage entry) external view returns (address) {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.getImplementation.selector);
        bytes memory r = entry.sCall(data);
        return abi.decode(r, (address));
    }

    function currentImplVersion(CachedModule storage entry) external view returns (ModuleVersion memory) {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.currentImplVersion.selector);
        bytes memory r = entry.sCall(data);
        return abi.decode(r, (ModuleVersion));
    }

    function setProxyImplementation(CachedModule storage entry, address newImplementation) external {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.setProxyImplementation.selector, newImplementation);
        entry.dCall(data);
    }

    function setAuthorizedRegistry(CachedModule storage entry, address registry) external {
        bytes memory data = abi.encodeWithSelector(IEntityFactory.setAuthorizedRegistry.selector, registry);
        entry.dCall(data);
    }

}

