// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.24;

import {ModuleVersion} from '../modules/IModule.sol';

library LibVersion {

    function greaterThan(ModuleVersion memory a, ModuleVersion memory b) internal pure returns (bool) {
        if (a.major > b.major) {
            return true;
        } else if (a.major == b.major) {
            return a.minor > b.minor;
        }
        return false;
    }

    function lessThan(ModuleVersion memory a, ModuleVersion memory b) internal pure returns (bool) {
        if (a.major < b.major) {
            return true;
        } else if (a.major == b.major) {
            return a.minor < b.minor;
        }
        return false;
    }
}

